from collections import defaultdict, deque
from typing import Dict, Deque

class Node:
    def __init__(self, value, parent=None):
        self.value = value
        self.parent = parent
        self.children = []

class Tree:
    def __init__(self, n):
        self.n = n
        self.root = Node(1, None)
        self.nodes = {1: self.root}
        self.in_degree = defaultdict(int)
        self.out_degree = defaultdict(int)

    def add_edge(self, parent, child):
        self.out_degree[parent] += 1
        self.in_degree[child] += 1
        self.nodes[child].parent = self.nodes[parent]
        self.nodes[parent].children.append(self.nodes[child])

    def check_root(self, root):
        if root.parent:
            return False
        return True

    def find_root(self):
        for child in self.nodes:
            if not self.nodes[child].parent:
                self.nodes[child].parent = self.nodes[child]
                return self.nodes[child]
        return None

    def _build_queue(self, node):
        queue = deque()
        for child in node.children:
            queue.append(child)
            if not child.parent:
                return queue
        return queue

    def build_heap(self):
        queue = deque()
        queue.append(self.root)
        while queue:
            node = queue.pop()
            for child in node.children:
                queue.append(child)
        return True

    def traverse_all_paths(self, root, n):
        queue = deque()
        queue.append((root, [root]))
        while queue:
            node, path = queue.pop()
            for child in node.children:
                new_path = path + [child]
                queue.append((child, new_path))
            if len(path) == n:
                yield path

class Solution:
    def find_longest_path(self, tree: Tree, n: int) -> int:
        if tree.n == 1:
            return 1
        elif tree.n <= 2:
            return 2
        else:
            longest_path = 0
            for root in tree.nodes:
                if tree.nodes[root].value == 1:
                    queue = tree._build_queue(tree.nodes[root])
                    while queue:
                        node = queue.popleft()
                        for child in node.children:
                            if child.value == 1:
                                if child.parent.value == 1:
                                    longest_path = max(longest_path, len(tree.traverse_all_paths(child, n)))
                                    break
                            else:
                                queue.append(child)
            return longest_path

