from pydantic import BaseModel
from typing import Tuple, List

class Input(BaseModel):
    matrix: List[List[int]]
    r: int
    s: int

class Output(BaseModel):
    ans: int

class Solution:
    def _validate_input(self, input: Input) -> bool:
        r = input.r
        s = input.s
        if r < 2 or s < 2:
            return False
        for row in input.matrix:
            if len(row)!= s:
                return False
        return True

    def _validate_submatrix(self, mat: List[List[int]], submatrix: Tuple[int, int]) -> bool:
        r, s = submatrix
        if r >= len(mat) or s >= len(mat[0]):
            return False
        sum_matrix = 0
        for i in range(r, r + 2):
            for j in range(s, s + 2):
                sum_matrix += mat[i][j]
        return sum_matrix <= mat[r][s] + mat[r][s + 1] + mat[r + 1][s] + mat[r + 1][s + 1]

    def _get_sum_cool_matrix(self, mat: List[List[int]], r: int, s: int) -> int:
        sum_matrix = 0
        for i in range(r, r + 2):
            for j in range(s, s + 2):
                sum_matrix += mat[i][j]
        return sum_matrix

    def _get_size_cool_matrix(self, mat: List[List[int]], r: int, s: int) -> int:
        sum_matrix = 0
        for i in range(r, r + 2):
            for j in range(s, s + 2):
                sum_matrix += mat[i][j]
        return sum_matrix

    def _get_all_cool_submatrices(self, mat: List[List[int]], r: int, s: int) -> int:
        cool_submatrices = []
        for i in range(r - 1, r + 1):
            for j in range(s - 1, s + 1):
                submatrix = (i, j)
                if self._validate_submatrix(mat, submatrix):
                    cool_submatrices.append(submatrix)
        return cool_submatrices

    def _get_all_submatrices(self, mat: List[List[int]]) -> List[Tuple[int, int]]:
        all_submatrices = []
        for i in range(len(mat)):
            for j in range(len(mat[0])):
                all_submatrices.append((i, j))
        return all_submatrices

    def _get_all_submatrices_of_size_2x2(self, mat: List[List[int]]) -> List[Tuple[int, int]]:
        all_2x2_submatrices = []
        for i in range(len(mat) - 1):
            for j in range(len(mat[0]) - 1):
                submatrix = (i, j)
                if self._validate_submatrix(mat, submatrix):
                    all_2x2_submatrices.append(submatrix)
        return all_2x2_submatrices

    def get_solution(self, input: Input) -> Output:
        if not self._validate_input(input):
            return Output(ans=0)

        mat = input.matrix
        all_cool_submatrices = []
        for submatrix in self._get_all_submatrices_of_size_2x2(mat):
            sum_matrix = self._get_sum_cool_matrix(mat, *submatrix)
            if sum_matrix > 0:
                all_cool_submatrices.append(submatrix)

        if not all_cool_submatrices:
            return Output(ans=0)

        max_cool_submatrix_size = 0
        max_cool_submatrix = None
        for submatrix in all_cool_submatrices:
            size_matrix = self._get_size_cool_matrix(mat, *submatrix)
            if size_matrix > max_cool_submatrix_size:
                max_cool_submatrix_size = size_matrix
                max_cool_submatrix = submatrix

        ans = max_cool_submatrix_size
        return Output(ans=ans)

