from collections import defaultdict
from copy import deepcopy

from aocpuzzle import Puzzle


class DayGiver(Puzzle):
    def __init__(self, input_content_lines):
        self.start_edges = defaultdict(set)
        self.end_edges = defaultdict(set)
        self.max_flow = 0
        self.max_flow_edges = []
        self.N = 0
        self.source_id = 0
        self.sink_id = 0

        for line in input_content_lines:
            first, second, capacity = line.split()
            first, second, capacity = int(first), int(second), int(capacity)
            self.start_edges[first].add((second, capacity))
            self.end_edges[second].add((first, capacity))

        self.start_edges = dict(self.start_edges)
        self.end_edges = dict(self.end_edges)

        self.visited = set()
        self.current_path = []
        self.path_edges = {}
        self.path_capacities = {}

    def solve(self):
        while True:
            self.visited = set()
            self.current_path = []
            self.path_edges = {}
            self.path_capacities = {}
            path = self.breadth_first_search()
            if path is None:
                break
            self.max_flow += sum(self.path_capacities.values())
            self.max_flow_edges.append((path[0], path[-1], self.path_capacities[path[-1]]))

        print(f"Part 1: {self.max_flow}")
        print(f"Part 2: {self.max_flow_edges}")

    def breadth_first_search(self):
        # get start and sink
        self.N = len(self.start_edges)
        self.source_id = list(self.start_edges.keys())[0]
        self.sink_id = list(self.end_edges.keys())[0]
        visited = set()

        q = [self.source_id]
        visited.add(self.source_id)
        path_edges = {}
        path_capacities = {}
        while q:
            current_id = q.pop(0)
            for neighbor_id, capacity in self.start_edges[current_id]:
                if neighbor_id not in visited:
                    if neighbor_id == self.sink_id:
                        return self.build_path(path_edges, path_capacities)
                    else:
                        q.append(neighbor_id)
                        visited.add(neighbor_id)
                        path_edges[neighbor_id] = current_id
                        path_capacities[neighbor_id] = capacity
        return None

    def build_path(self, path_edges, path_capacities):
        path = [self.sink_id]
        current_id = self.sink_id
        while path_edges.get(current_id, None) is not None:
            path.insert(0, path_edges[current_id])
            current_id = path_edges[current_id]
        return path, sum(path_capacities.values())

