from typing import List
import numpy as np
import copy

class Board:

    def __init__(self, board: List[List[str]]):
        self.board = np.array(board)
        self.rows = self.board.shape[0]
        self.cols = self.board.shape[1]

    def change_char(self, row: int, col: int, char: str) -> None:
        self.board[row, col] = char

    def change_position(self, row_i: int, col_i: int, row_f: int, col_f: int) -> None:
        self.board[row_i, col_i] = '.'
        self.board[row_f, col_f] = 'O'

    def is_valid(self, row: int, col: int) -> bool:
        return row >= 0 and row < self.rows and col >= 0 and col < self.cols

    def validate(self) -> bool:
        for i in range(self.rows):
            for j in range(self.cols):
                if self.board[i, j] == '.':
                    if self.is_valid(i + 1, j) and self.board[i + 1, j] == 'O':
                        return False
                    if self.is_valid(i - 1, j) and self.board[i - 1, j] == 'O':
                        return False
                    if self.is_valid(i, j + 1) and self.board[i, j + 1] == 'O':
                        return False
                    if self.is_valid(i, j - 1) and self.board[i, j - 1] == 'O':
                        return False
        return True

    def move(self, row_i: int, col_i: int, row_f: int, col_f: int) -> bool:
        if not self.is_valid(row_i, col_i) or not self.is_valid(row_f, col_f):
            return False
        self.change_position(row_i, col_i, row_f, col_f)
        return True

    def get_board(self) -> List[List[str]]:
        return self.board

