from typing import List
import itertools


class Package:
    def __init__(self, name: str):
        self.name = name
        self.dependencies = set()


class Solution:
    def __init__(self):
        self.packages = {}

    def build_graph(self, input_str: str) -> List[Package]:
        package_list = input_str.strip().split("\n")
        for package in package_list:
            self.packages[package] = Package(package)

        for package in package_list:
            self.packages[package].dependencies = set(
                [
                    dep.strip()
                    for dep in package.split(" ")[1:]
                    if dep.strip() not in self.packages
                ]
            )

    def can_order(self, package_names: List[str]) -> bool:
        # Check if package_names has any dependencies that are not already installed
        for package in package_names:
            if package not in self.packages:
                return False
        for package in self.packages.values():
            if package.name in package_names:
                for dependency in package.dependencies:
                    if dependency not in package_names:
                        return False
        return True

    def order_packages(self, package_names: List[str]) -> List[str]:
        if not self.can_order(package_names):
            return "cannot be ordered"

        # Find a starting point, one package that has no dependencies
        #   and is ready to be installed
        for package in self.packages.values():
            if not package.dependencies and package.name in package_names:
                current_package = package.name
                break

        # Build the ordering of packages to install
        order = [current_package]
        while current_package in self.packages:
            for package in self.packages.values():
                if package.name == current_package:
                    for dependency in package.dependencies:
                        if dependency in order:
                            current_package = package.name
                            break
                    else:
                        order.append(current_package)
                        break

        return order

