from icontract import require, ensure


class Base:
    """Represent an arbitrary base."""

    @require(lambda digits: all(0 <= digit <= 9 for digit in digits))
    @require(lambda digits: len(digits) >= 1)
    @require(lambda digits: len(digits) <= 10 ** 4)
    def __init__(self, digits: tuple[int,...]) -> None:
        self.digits = digits

    @classmethod
    def from_int(cls, integer: int) -> Base:
        """Represent an integer in the given base."""
        return cls(tuple(map(int, reversed(str(integer)))))

    def to_int(self) -> int:
        """Represent the given base as an integer."""
        return int("".join(map(str, self.digits)))

    @require(lambda other: isinstance(other, Base))
    def __add__(self, other: Base) -> Base:
        """Add two bases together."""
        return Base(
            tuple(a + b for a, b in zip(self.digits, other.digits))
        )

    @ensure(lambda result: not (result < 0))
    def __sub__(self, other: Base) -> int:
        """Subtract two bases together."""
        return self.to_int() - other.to_int()

    def __repr__(self) -> str:
        """Represent the given base as a string."""
        return f"{self.__class__.__name__}({', '.join(map(str, self.digits))})"

    @require(lambda other: isinstance(other, int))
    def __mul__(self, other: int) -> Base:
        """Multiply a base by an integer."""
        return Base(tuple(digit * other for digit in self.digits))

    @require(lambda other: isinstance(other, int))
    def __floordiv__(self, other: int) -> int:
        """Divide a base by an integer."""
        return self.to_int() // other

    def __hash__(self) -> int:
        """Hash the given base."""
        return hash(self.to_int())

    def __eq__(self, other: object) -> bool:
        """Check if two bases are equal."""
        if not isinstance(other, Base):
            return NotImplemented

        return self.digits == other.digits

