class LRU_Cache:
    def __init__(self, capacity):
        # Initialize class variables
        self.dic = OrderedDict()
        self.capacity = capacity
        self.head = None
        self.tail = None
        self.size = 0

    def get(self, key):
        # Retrieve item from provided key. Return -1 if nonexistent. 
        if key not in self.dic:
            return -1
        node = self.dic[key]
        if node!= self.head and node!= self.tail:
            self.__remove(node)
            self.__add(node)
        return node.value

    def set(self, key, value):
        # Set the value if the key is not present in the cache. If the cache is at capacity remove the oldest item. 
        if key in self.dic:
            self.__remove(self.dic[key])
        else:
            if self.size == self.capacity:
                self.__remove(self.tail)
        self.size += 1
        self.__add(Node(key, value))

    def __remove(self, node):
        if node == self.head:
            self.head = node.next
        if node == self.tail:
            self.tail = node.prev
        if node.next:
            node.next.prev = node.prev
        if node.prev:
            node.prev.next = node.next
        self.dic.pop(node.key)
        self.size -= 1

    def __add(self, node):
        if self.head == None:
            self.head = node
            self.tail = node
        else:
            self.tail.next = node
            node.prev = self.tail
            self.tail = node
        self.dic[node.key] = node


    def __str__(self):
        if self.head == None:
            return "head, tail: ({}, {})".format(self.head, self.tail)
        else:
            s = ""
            node = self.head
            while node!= self.tail:
                s += "({}, {}) -> ".format(node.key, node.value)
                node = node.next
            s += "({}, {})".format(node.key, node.value)
            return s

