from collections import defaultdict


class Room:
    def __init__(self, num, exits):
        self.num = num
        self.exits = exits


class Maze:
    def __init__(self, n, rooms, corridors):
        self.rooms = [Room(num, exits) for num, exits in enumerate(rooms, 1)]
        self.corridors = defaultdict(list)
        for i in range(corridors):
            start, end = [int(n) for n in input().split()]
            self.corridors[start].append(end)
            self.corridors[end].append(start)

    def __find_identical_rooms(self):
        self.identical_rooms = set()
        for i in range(len(self.rooms)):
            for room in self.rooms:
                if i in room.exits:
                    self.identical_rooms.add(room.num)
                    self.identical_rooms.add(i)

    def __find_intersections(self):
        self.intersections = set()
        for room in self.rooms:
            if room.num not in self.identical_rooms:
                self.intersections.update(room.exits)

    def __find_groups(self):
        self.groups = set()
        for room in self.rooms:
            if room.num not in self.identical_rooms:
                self.groups.add(room.num)
                self.groups.update(self.corridors[room.num])

    def __find_isolated_rooms(self):
        self.isolated_rooms = []
        for room in self.rooms:
            if room.num not in self.identical_rooms:
                self.isolated_rooms.append(room.num)

    def __find_non_isolated_groups(self):
        self.non_isolated_groups = []
        for room in self.rooms:
            if room.num not in self.identical_rooms:
                self.non_isolated_groups.append(set(self.corridors[room.num]))

    def print_solution(self):
        self.__find_identical_rooms()
        self.__find_intersections()
        self.__find_groups()
        self.__find_isolated_rooms()
        self.__find_non_isolated_groups()
        self.non_isolated_groups = sorted(self.non_isolated_groups)
        print(' '.join([str(room) for room in self.non_isolated_groups]))
        print(' '.join([str(room) for room in self.groups]))
        print(' '.join([str(room) for room in self.identical_rooms]))
        print(' '.join([str(room) for room in self.intersections]))
        print(' '.join([str(room) for room in self.isolated_rooms]))

